import React,{useEffect, useState} from 'react';
import './App.css';
import Card from './components/card/card';
import getCardData from './services/getData';



function App() {
  const [data, setData] = useState();

  const loadData = async () => {
    const data = await getCardData();
    setData(data);
  }

  return (
    <div className="App">
      <Card data={data}/>
    </div>
  );
}

export default App;
